  ;

feature
  // method
  : ID '(' formal? comma_formal* ')' ':' TYPE '{' expr '}'
    {
      params = []
      if ($3 != undefined) params.push($3)
      params = params.concat($4)
      $$ = {nodeType: 'method', name: $1, body: $9, params: params, returnType: $7}
