import React, { useState } from "react"

import "./styles.scss"

export default function LexingUIContainer({ tokens, input }) {
  const [hoveredToken, setHoveredToken] = useState(null)
  const [tooltipLoc, setTooltipLoc] = useState(null)

  let lexedInput = []
  let inputInd = 0
  let tokenInd = 0

  const onMouseOver = (e, token) => {
    const spanRect = e.target.getBoundingClientRect()
    const codeRect = e.target.parentElement.getBoundingClientRect()
    setTooltipLoc({
      x: spanRect.x - codeRect.x + spanRect.width + 10,
      y: spanRect.y - codeRect.y - spanRect.height - 4
    })
    setHoveredToken(token)
  }
  const onMouseOut = () => {
    setHoveredToken(null)
    setTooltipLoc(null)
  }

  while (inputInd < input.length) {
    if (tokenInd < tokens.length && inputInd === tokens[tokenInd].start) {
      const token = tokens[tokenInd]
      lexedInput.push(
        <span
          key={inputInd}
          onMouseOver={(e) => onMouseOver(e, token)}
          onMouseOut={onMouseOut}
          className={token.class}>
          {token.lexeme}
        </span>
      )
      inputInd += token.length
      tokenInd += 1
    } else {
      lexedInput.push(
        <span
          className="UNIDENTIFIED"
          onMouseOver={(e) => onMouseOver(e, {class: "ERROR: unrecognized token"})}
          onMouseOut={onMouseOut}
          key={inputInd}>{
          input[inputInd]}
        </span>)
      inputInd += 1
    }
  }

  return (
    <div id="lexing-ui-container">
      <p>
        Below is the lexed code with coloring to distinguish different token classes.
        Hover over a token to see its class.
      </p>
      <pre className="lexed-input">
        {lexedInput}
        {hoveredToken && hoveredToken.class !== "WHITESPACE" &&
          <p
            style={{top: tooltipLoc.y, left: tooltipLoc.x}}
            className="tooltip">{hoveredToken.class}</p>}
      </pre>
    </div>
  )
}

import { v4 as uuidv4 } from 'uuid';

export function isAncestor(node, parentNodeId) {
  if (node.id === parentNodeId) return true
  if (!node.parent) return false
  return isAncestor(node.parent, parentNodeId)
}

export function getParentFunction(node) {
  if (node.nodeType === "function") return node
  if (!node.parent) {
    console.error("Incorrect use of getParentFunction()")
    return null
  }
  return getParentFunction(node.parent)
}

function expressionChildren(parseTreeNode) {
  switch (parseTreeNode.expressionType) {
    case "invocation": return parseTreeNode.args
    case "if": return [
      parseTreeNode.predicateLHS,
      parseTreeNode.predicateRHS,
      parseTreeNode.trueBranch,
      parseTreeNode.falseBranch,
    ]
    case "+":
    case "-":
      return [parseTreeNode.lhs, parseTreeNode.rhs]
    case "vid":
    case "literal":
      return []
    default:
      console.error(`Unknown expression type: ${parseTreeNode.expressionType}`)
      return []
  }
}

export function children(parseTreeNode) {
  switch (parseTreeNode.nodeType) {
    case "program": return parseTreeNode.functions
    case "function": return [parseTreeNode.body]
    case "expression": return expressionChildren(parseTreeNode)
    default:
      console.error("Unknown node type in children: " + parseTreeNode.nodeType)
      return []
  }
}

export function addIds(parseTreeNode) {
  parseTreeNode.id = uuidv4()
  for (const child of children(parseTreeNode)) {
    addIds(child)
  }
}

export function doublyLinkTree(parseTreeNode) {
  for (const child of children(parseTreeNode)) {
    child.parent = parseTreeNode
    doublyLinkTree(child)
  }
}

import React from "react"
import { isAncestor } from './parse_tree_utils'

function ProgramNode({ node, focusedNodeId }) {
  const children = node.functions.map((n, i) => (
    <FunctionNode
      node={n}
      focusedNodeId={focusedNodeId}
      key={i} />
  ))
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node program " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">{node.nodeType}</p>
      {children}
    </div>
  )
}

function FunctionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node function " + (focused ? "focused" : "")}
      data-id={node.id}
    >
      <p className="node-type">{node.nodeType}</p>
      <p>{`Function name: ${node.fid}`}</p>
      <p>Function body:</p>
      <ExpressionNode node={node.body} focusedNodeId={focusedNodeId} />
    </div>
  )
}

function ExpressionNode({ node, focusedNodeId }) {
  let Type
  switch (node.expressionType) {
    case "invocation": Type = InvocationExpressionNode; break;
    case "if": Type = IfExpressionNode; break;
    case "+": Type = AdditionExpressionNode; break;
    case "-": Type = SubtractionExpressionNode; break;
    case "vid": Type = VidExpressionNode; break;
    case "literal": Type = LiteralExpressionNode; break;
    default: Type = UnknownExpressionNode;
  }
  return <Type node={node} focusedNodeId={focusedNodeId} />
}

function UnknownExpressionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p style={{color: 'red'}}>Unknown</p>
      <p className="node-type">expression</p>
      <p>{`Expression type: ${node.expressionType}`}</p>
    </div>
  )
}

function InvocationExpressionNode({ node, focusedNodeId }) {
  const args = node.args.map((arg) => (
    <ExpressionNode node={arg} focusedNodeId={focusedNodeId} key={arg.id} />
  ))

  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">Function Invocation</p>
      <p>{`Invoked function: ${node.fid}`}</p>
      <p>Arguments:</p>
      {args}
    </div>
  )
}

function IfExpressionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">If-then-else</p>
      <p>Predicate LHS:</p>
      <ExpressionNode node={node.predicateLHS} focusedNodeId={focusedNodeId} />
      <p>Predicate RHS:</p>
      <ExpressionNode node={node.predicateRHS} focusedNodeId={focusedNodeId} />
      <p>True branch:</p>
      <ExpressionNode node={node.trueBranch} focusedNodeId={focusedNodeId} />
      <p>False branch:</p>
      <ExpressionNode node={node.falseBranch} focusedNodeId={focusedNodeId} />
    </div>
  )
}

function AdditionExpressionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">Addition</p>
      <p>LHS:</p>
      <ExpressionNode node={node.lhs} focusedNodeId={focusedNodeId} />
      <p>RHS:</p>
      <ExpressionNode node={node.rhs} focusedNodeId={focusedNodeId} />
    </div>
  )
}

function SubtractionExpressionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">Subtraction</p>
      <p>LHS:</p>
      <ExpressionNode node={node.lhs} focusedNodeId={focusedNodeId} />
      <p>RHS:</p>
      <ExpressionNode node={node.rhs} focusedNodeId={focusedNodeId} />
    </div>
  )
}

function VidExpressionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">Variable reference</p>
      <p>{`Variable name: ${node.value}`}</p>
    </div>
  )
}

function LiteralExpressionNode({ node, focusedNodeId }) {
  const focused = isAncestor(node, focusedNodeId)
  return (
    <div
      className={"parse-tree-node expression " + (focused ? "focused" : "")}
      data-id={node.id}>
      <p className="node-type">Literal</p>
      <p>{`Value: ${node.value}`}</p>
    </div>
  )
}

export default function ParsingUIContainer({ parseTree, focusedNodeId, setFocusedNodeId }) {
  const onMouseOver = (e) => {
    if (!e.target.classList.contains("parse-tree-node")) return
    const nodeId = e.target.getAttribute("data-id")
    setFocusedNodeId(nodeId)
  }
  const onMouseOut = (e) => {
    // unset if we've moused out of the tree UI
    if (e.target.id === "parsing-ui-container") {
      setFocusedNodeId(null)
    }
  }

  return (
    <div
      id="parsing-ui-container"
      onMouseOver={onMouseOver}
      onMouseOut={onMouseOut}
    >
      <h2>Parse Tree:</h2>
      {parseTree &&
        parseTree.error ?
          <div className="parse-error">
            <pre>{parseTree.error}</pre>
          </div>
          :
          <ProgramNode node={parseTree} focusedNodeId={focusedNodeId} />}
    </div>
  )
}

