import React from "react"
import * as d3 from "d3"
import { colors, arr_sum } from "./utils"

class SunburstChart extends React.Component {
  render() {
    return (
      <div id="sunburst-chart" className="canvas">
        <svg></svg>
      </div>
    )
  }

  componentDidMount() {
    let height = 300;
    let width = 300;
    let radius = 80;
    let transitionDuration = 300;

    let svg = d3.select("#sunburst-chart svg")
      .attr("width", width)
      .attr("height", height);

    let pie = d3.pie().sort(null);

    let data = [
      [1, 1],
      [3, 1, 2],
      [4, 2, 1, 2],
      [1, 3],
    ];

    const calcGroup = (ind) => {
      let bins = data.map((arr) => arr.length);
      for (let i = 1; i < bins.length; i++) {
        bins[i] = bins[i - 1] + bins[i];
      }
      for (const [i, x] of bins.entries()) {
        if (ind < x) {
          return i;
        }
      }
    }

    let arcOuter = d3.arc()
      .innerRadius(0)
      .outerRadius(radius);
    let largeArcOuter = d3.arc()
      .innerRadius(0)
      .outerRadius(radius * 1.5)

    const transitionArcGroup = (ind, newArc) => {
      svg.selectAll(".outer .group" + ind).transition()
        .delay(100)
        .duration(transitionDuration)
        .attr("d", newArc);
    }

    // draw outer pie first so it can hide under the inner one
    let gOuter = svg.append("g")
      .attr("class", "outer")
      .attr("transform", "translate(" + width / 2 + "," + height / 2 + ")");

    let outerData = data.reduce((arr1, arr2) => arr1.concat(arr2));

    let arcsOuter = gOuter.selectAll("arc")
      .data(pie(outerData))
      .enter().append("g")
        .attr("class", "arc");

    arcsOuter.append("path")
      .attr("class", (d, i) => "group" + calcGroup(i))
      .attr("fill", (d, i) => colors[calcGroup(i) * 4 + i % 4])
      .attr("stroke-width", 2)
      .style("opacity", 0.8)
      .attr("d", arcOuter)
      .on("mouseover", (d, i, nodes) => {
        d3.select(nodes[i])
          .attr("stroke", "black")
          .style("opacity", 1);
        // include arc group transition handler here as well as on the
        // inner sections so we can mouseover the expanded sections
        transitionArcGroup(calcGroup(i), largeArcOuter);
      })
      .on("mouseout", (d, i, nodes) => {
        d3.select(nodes[i])
          .attr("stroke", "none")
          .style("opacity", 0.8);
        transitionArcGroup(calcGroup(i), arcOuter);
      });

    // inner pie
    let dataInner = data.map(arr_sum);

    let gInner = svg.append("g")
      .attr("class", "inner")
      .attr("transform", "translate(" + width / 2 + "," + height / 2 + ")");

    let arcInner = d3.arc()
      .innerRadius(0)
      .outerRadius(radius);

    let arcsInner = gInner.selectAll("arc")
      .data(pie(dataInner))
      .enter().append("g")
        .attr("class", "arc");

    arcsInner.append("path")
      .attr("class", (d, i) => "group" + i)
      .attr("fill", (d, i) => colors[i * 4])
      .attr("d", arcInner)
      .on("mouseover", (d, i) => transitionArcGroup(i, largeArcOuter))
      .on("mouseout", (d, i) => transitionArcGroup(i, arcOuter));
  }
}

export default SunburstChart

import React from "react"
import * as d3 from "d3"

const identity = (x) => x

export default class TechViz extends React.Component {
  render() {
    return (
      <div id="tech-viz" className="canvas">
        <svg></svg>
      </div>
    )
  }

  componentDidMount() {
    let svg = d3.select("#tech-viz svg")
      .attr("height", 300)
      .attr("width", 350)

    let data = [
      {
        "category": "languages",
        "items": ["js", "rb", "py", "c++", "cljs"]
      },
      {
        "category": "frontend",
        "items": ["js", "react", "cljs", "d3"]
      },
      {
        "category": "backend",
        "items": ["postgres", "rails", "c++", "rb", "flask", "aws", "redis"]
      },
      {
        "category": "data",
        "items": ["d3", "py", "tableau", "spark", "airflow", "sql"]
      },
    ]

    let _categories = []
    let _techs = []
    let categories_lkup = {}
    for (const { category, items } of data) {
      _categories.push(category)
      for (const item of items) {
        _techs.push(item)
        // an item can be in multiple categories
        if (categories_lkup.hasOwnProperty(item)) {
          categories_lkup[item].push(category)
        } else {
          categories_lkup[item] = [category]
        }
      }
    }
    _techs = [...new Set(_techs)]

    // layout doesn't work when M != N
    const M = 4,
          N = 4;

    // index of current category
    let ind = 0

    let techsGroup = svg.append("g")
      .attr("class", "techs")


    const updateCategory = function() {
      const category = _categories[ind % _categories.length]

      _techs.sort((d1, d2) => {
        const isMember = (item) => (+ categories_lkup[item].includes(category))
        return isMember(d2) - isMember(d1)
      })

      const t = techsGroup.transition().duration(500)

      const xFn = (d, i) => 70 * (i % M) + 50
      const yFn = (d, i) => 50 * (Math.floor(i / N)) + 80
      const opacityFn = (d) => categories_lkup[d].includes(category) ? 1 : 0.7
      const fontWeightFn = (d) => categories_lkup[d].includes(category) ? 500 : 300

      techsGroup.selectAll("text")
        .data(_techs, identity)
        .join(
          enter => enter.append("text")
            .attr("class", (d) => categories_lkup[d].join(" "))
            .text(identity)
            .style("opacity", opacityFn)
            .style("font-weight", fontWeightFn)
            .style("cursor", "default")
            .attr("x", xFn)
            .attr("y", yFn)
            // TODO center by calculating width
            .style("transform", (d) => `translate(-${d.length / 4}em)`),
          update => update
            .call(update => update.transition(t)
              .attr("x", xFn)
              .attr("y", yFn)
              .style("opacity", opacityFn)
              .style("font-weight", fontWeightFn)
            ),
          exit => exit.remove(),
        )

      svg.selectAll(".categories text")
        .style("font-weight", (d, i) => i === ind ? 500 : 300)
        .transition().duration(500)
          .style("opacity", (d, i) => i === ind ? 1 : 0.7)

      ind++
    }

    const handleMouseover = function(d, i) {
      // use index so this is composable with setting an interval
      // to cycle categories
      ind = i
      updateCategory()
    }

    svg.append("g")
      .attr("class", "categories")
      .selectAll("text")
      .data(_categories, identity)
      .enter().append("text")
        .attr("class", identity)
        .text(identity)
        .attr("x", (d, i) => 100 * i)
        .attr("y", 20)
        .style("cursor", "default")
        .style("font-size", "18px")
        .style("font-weight", (d, i) => i === ind ? 500 : 300)
        .style("opacity", (d, i) => i === ind ? 1 : 0.7)
        .on("mouseover", handleMouseover)

    updateCategory()
  }
}

import React from "react"
import * as d3 from "d3"
import { arr_sum } from "./utils"

class VolumeCalendar extends React.Component {
  render() {
    return (
      <div id="volume-calendar" className="canvas">
        <svg width="450" height="200"></svg>
      </div>
    )
  }

  componentDidMount() {
    let svg = d3.select("#volume-calendar svg")
    let cell_width = 32;
    let cell_height = 32;
    let width = 7 * cell_width; // 7 days a week
    let height = 4 * cell_height; // display 4 weeks
    let calendar_top_x = 20;
    let calendar_top_y = 20;

    let data = [
      [0, 4, 0, 5, 0, 0, 3],
      [0, 6, 7, 4, 0, 0, 2],
      [3, 0, 0, 4, 0, 2, 0],
      [0, 4, 4, 0, 6, 0, 0],
    ]
    let daily_max = d3.max(data.map((arr) => d3.max(arr)));
    let weekly_max = d3.max(data.map((arr) => arr_sum(arr)));

    let x_scale = d3.scaleLinear()
      .domain([0, 7])
      .range([0, width]);
    let y_scale = d3.scaleLinear()
      .domain([0, 4])
      .range([0, height]);
    let r_scale = d3.scaleSqrt()
      .domain([0, daily_max])
      .range([0, 8]);
    let bar_scale = d3.scaleLinear()
      .domain([0, weekly_max])
      .range([0, 150]);

    let day_names = ["M", "T", "W", "T", "F", "S", "S"]

    const renderRow = function(d) {
      let day_cell = d3.select(this).selectAll("g.day")
        .data(d)
        .enter().append("g")
          .attr("class", "day")
          .style("transform", (d, i) => "translate(" + x_scale(i) + "px,0)");
      // make uniformly sized area to capture mouseover
      day_cell.append("rect")
        .attr("class", "event-capture")
        .attr("fill", "none")
        .attr("stroke", "none")
        .style("pointer-events", "all")
        .style("x", -cell_width / 2)
        .style("y", -cell_height / 2)
        .style("width", cell_width)
        .style("height", cell_height)
        .on("mouseover", handleMouseover)
        .on("mouseout", handleMouseout);
      day_cell.append("circle")
        .style("shape-rendering", "geometricPrecision")
        .style("pointer-events", "none")
        .attr("r", (d) => (d === 0) ? 1 : r_scale(d))
        .attr("fill", (d) => (d === 0) ? "#a1a1aa" : "black");
      day_cell.append("text")
        .style("pointer-events", "none")
        .attr("x", -5)
        .attr("y", 6)
        .style("opacity", 0)
        .style("font-weight", 500)
        .text((d) => (d === 0) ? "" : d);
    }

    const handleMouseover = function(d) {
      if (d > 0) {
        let g = d3.select(this.parentNode);
        opacityTransition(g.select("circle"), 0);
        opacityTransition(g.select("text"), 1);
      }
    }

    const handleMouseout = function(d) {
      if (d > 0) {
        let g = d3.select(this.parentNode);
        opacityTransition(g.select("circle"), 1);
        opacityTransition(g.select("text"), 0);
      }
    }

    const opacityTransition = function(d3_node, opacity) {
      d3_node.transition()
        .style("opacity", opacity)
        .duration(300);
    }


    let frame = svg.append("g")
      .style("transform", "translate(" + calendar_top_x + "px," + calendar_top_y + "px)");

    let calendar = frame.append("g")
      .attr("class", "calendar")

    // draw calendar week rows
    calendar.selectAll("g.row")
      .data(data)
      .enter().append("g")
        .attr("class", "row")
        .style("transform", (d, i) => "translate(0," + y_scale(i + 1) + "px)")
      .each(renderRow);

    // display weekday names above calendar
    frame.append("g")
      .attr("class", "header")
      .selectAll(".day-label")
        .data(day_names)
        .enter().append("text")
          .attr("class", "day-label")
          .style("font-size", 15)
