import black_king from './icons/black_king.svg'
import white_king from './icons/white_king.svg'
import black_rook from './icons/black_rook.svg'
import white_rook from './icons/white_rook.svg'
import black_knight from './icons/black_knight.svg'
import white_knight from './icons/white_knight.svg'

export const PIECE_SVG_MAP = {
  black_king,
  white_king,
  black_rook,
  white_rook,
  black_knight,
  white_knight,
}

export const WHITE_KING   = {color: 'white', piece: 'king'},
             WHITE_KNIGHT = {color: 'white', piece: 'knight'},
             WHITE_ROOK   = {color: 'white', piece: 'rook'},
             BLACK_KING   = {color: 'black', piece: 'king'},
             BLACK_KNIGHT = {color: 'black', piece: 'knight'},
             BLACK_ROOK   = {color: 'black', piece: 'rook'}

const INITIAL_BOARD_STATE = [
  WHITE_KING,
  WHITE_KNIGHT,
  WHITE_ROOK,
  null,
  null,
  BLACK_ROOK,
  BLACK_KNIGHT,
  BLACK_KING
]

export function initialState() {
  return {
    timeline: [INITIAL_BOARD_STATE.slice()],
    timelineInd: 0,
    selectedPiece: null, // index in this.state.board
  }
}

export function other(color) {
  return color === "white" ? "black" : "white"
}

export function isColorsPiece(piece, color) {
  return piece != null && piece.color === color
}

function kingFor(color) {
  return color === "white" ? WHITE_KING : BLACK_KING
}

// This name is a little misleading, so use with caution
function samePiece(p1, p2) {
  return p1 != null && p2 != null && p1.color === p2.color && p1.piece === p2.piece
}

export function capitalize(str) {
  if (str === "") return ""
  return str[0].toUpperCase() + str.slice(1).toLowerCase()
}

function destinationSquaresForKing(board, pieceInd) {
  let squares = []
  if (pieceInd > 0) squares.push(pieceInd - 1)
  if (pieceInd < board.length - 1) squares.push(pieceInd + 1)
  return squares
}

function destinationSquaresForKnight(board, pieceInd) {
  let squares = []
  if (pieceInd > 1) squares.push(pieceInd - 2)
  if (pieceInd < board.length - 2) squares.push(pieceInd + 2)
  return squares
}

function destinationSquaresForRook(board, pieceInd) {
  let squares = []
  const { color } = board[pieceInd]
  // explore backwards and forwards until end of board or piece
  // TODO: clean up
  for (let i = pieceInd - 1; i >= 0; i--) {
    if (board[i] == null) {
      squares.push(i)
    } else if (isColorsPiece(board[i], other(color))) {
      squares.push(i)
      break
    } else {
      break
    }
  }
  for (let i = pieceInd + 1; i < board.length; i++) {
    if (board[i] == null) {
      squares.push(i)
    } else if (isColorsPiece(board[i], other(color))) {
      squares.push(i)
      break
    } else {
      break
    }
  }
  return squares
}

function destinationSquaresForPiece(board, pieceInd) {
  let destSquares
  const { piece, color } = board[pieceInd]
  if (piece === "king") {
    destSquares = destinationSquaresForKing(board, pieceInd)
  } else if (piece === "knight") {
    destSquares = destinationSquaresForKnight(board, pieceInd)
  } else if (piece === "rook") {
    destSquares = destinationSquaresForRook(board, pieceInd)
  } else {
    console.warn("Unknown piece")
  }

  // can't move to a square occupied by your own piece
  return destSquares.filter(dest => !isColorsPiece(board[dest], color))
}

// Returns List[Move], Move: [src, dest]
export function legalMovesForPiece(board, pieceInd) {
  if (pieceInd == null) return []

  let destSquares = destinationSquaresForPiece(board, pieceInd)
  // can't make a move that would put your king in check
  destSquares = destSquares.filter(dest => !isCheck(makeMove(board, [pieceInd, dest]), board[pieceInd].color))

  return destSquares.map(dest => [pieceInd, dest])
}

export function isLegalMove(board, move) {
  const legalMoves = legalMovesForPiece(board, move[0])
  let legalMove = false
  for (const [_, dest] of legalMoves) {
    if (dest === move[1]) legalMove = true
  }
  return legalMove
}

// Apply `fn` to each piece of a given color and return the accumulated results.
function generateForEachPieceOfColor(fn, board, color) {
  let result = []
  for (let i = 0; i < board.length; i++) {
    if (board[i] != null && board[i].color === color) {
      result = result.concat(fn(board, i))
    }
  }
  return result
}

export function legalMovesForColor(board, color) {
  return generateForEachPieceOfColor(legalMovesForPiece, board, color)
}

function destinationSquaresForColor(board, color) {
  return generateForEachPieceOfColor(destinationSquaresForPiece, board, color)
}

// Does not check that a move is legal
export function makeMove(board, move) {
  const [src, dest] = move
  board = board.slice()
  board[dest] = board[src]
  board[src] = null
  return board
}

export function isCheck(board, color) {
  const moves = destinationSquaresForColor(board, other(color))
  for (const dest of moves) {
    if (samePiece(board[dest], kingFor(color))) {
      return true
    }
  }
  return false
}

export function hasNoLegalMoves(board, color) {
  return legalMovesForColor(board, color).length == 0
}

export function isDraw(board) {
  // If the rooks are off the board, no checkmates exist.
  for (const piece of board) {
    if (samePiece(piece, WHITE_ROOK) || samePiece(piece, BLACK_ROOK)) {
      return false
    }
  }
  return true
}

export function isStalemate(board, color) {
  return hasNoLegalMoves(board, color) && !isCheck(board, color)
}

export function isCheckmate(board, color) {
  return hasNoLegalMoves(board, color) && isCheck(board, color)
}

function scorePieceValues(board) {
  let result = 0

  for (const pieceData of board) {
    if (pieceData == null) continue
    const { color, piece } = pieceData

    let score
    if (piece === "king") score = 100
    else if (piece === "rook") score = 10
    else score = 5

    score = color === "white" ? score : -score
    result += score
  }

  return result
}

// Scores the board from the perspective of the given color.
// Takes into account stalemate and checkmate
export function scoreBoard(board) {
  if (isStalemate(board, "white") || isStalemate(board, "black") || isDraw(board)) return 0
  if (isCheckmate(board, "white")) return -100
  if (isCheckmate(board, "black")) return 100

  return scorePieceValues(board)
}

function positionOf(piece, board) {
  for (let i = 0; i < board.length; i++) {
    if (samePiece(piece, board[i])) {
      return i
    }
  }
  return -1
}

// Given two boards, return the move that must have been played in between.
export function moveBetween(board1, board2) {
  // the move will be a piece on both boards in a different place
  for (const piece of board2) {
    // don't have to check if positionOf returns -1 because we're iterating through board2,
    // so we'll find capturing pieces and not captured pieces
    if (positionOf(piece, board1) != positionOf(piece, board2)) {
      return [positionOf(piece, board1), positionOf(piece, board2)]
    }
  }
  return null
}

function serializePiece(piece) {
  if (piece == null) return "null"
  return piece.color + piece.piece
}

// Not meant to be human readable.
export function serializeGameState(board, colorToMove) {
  let result = ""
  for (const piece of board) {
    result += serializePiece(piece)
  }
  result += colorToMove
  return result
}

import React from "react"
import * as d3 from "d3"

import * as graphUtils from "../../../src/js/graphs.js"

import nodesData from "./data/heavenly/nodes.json"
import edgesData from "./data/heavenly/edges.json"

const SVG_WIDTH = 500,
      SVG_HEIGHT = 500

const colorMap = {
  "blue": "#1E88E5",
  "green": "#229954"
}

const delay = 500
const fadeInText  = () => d3.select("#ski-graph .text").transition().duration(delay).style("opacity", 1)
const fadeOutText = () => d3.select("#ski-graph .text").transition().duration(delay).style("opacity", 0)

// moving these functions out of graphUtils for now.
function makeAdjacencyList(edges, nodes) {
  let adjacencyList = new Map()
  for (const {start, end} of edges) {
    if (adjacencyList.has(start)) {
      adjacencyList.get(start).push(end)
    } else {
      adjacencyList.set(start, [end])
    }
  }
  for (let i = 0; i < nodes.length; i++) {
    if (!adjacencyList.has(i)) adjacencyList.set(i, [])
  }
  return adjacencyList
}

// takes start and end nodes and returns [path_exists, path]
function bfs(start, end, edges, nodes) {
  if (start === end) return [true, [start]]

  const adjacencyList = makeAdjacencyList(edges, nodes)

  let q = [[start]]
  let seen = new Set([start])

  while (!(q.length === 0)) {
    const q_length = q.length
    for (let i = 0; i < q_length; i++) {
      const path = q[i]
      const curr_node = path[path.length - 1]
      for (const neighbor of adjacencyList.get(curr_node)) {
        if (neighbor === end) {
          return [true, path.concat(neighbor)]
        }
        if (!seen.has(neighbor)) {
          seen.add(neighbor)
          q.push(path.concat(neighbor))
        }
      }
    }
    q = q.slice(q_length)
  }
  return [false, []]
}

function highlightPath(path, onAnimationFinish = () => {}, transitionLength = 500, delayUnit = 100) {
  // TODO: it might look better if animation duration depended on edge length
  d3.selectAll("g.node, g.edge").transition().duration(300).style("opacity", 0.3)

  d3.selectAll("g.node")
    .each((_, i, nodes) => {
      if (path.includes(i)) {
        d3.select(nodes[i])
          .transition()
          .duration(transitionLength)
          .delay(path.indexOf(i) * 2 * delayUnit + 3 * delayUnit)
            .style("opacity", 1)
      }
    })

  d3.selectAll("g.edge")
    .each((_, i, nodes) => {
      d3.select(nodes[i])
        .transition()
        .duration(transitionLength)
        .delay((d) => {
          for (let j = 0; j < path.length - 1; j++) {
            if (path[j] === d.start && path[j + 1] === d.end) {
              return (j * 2 + 1)* delayUnit + 3 * delayUnit
            }
          }
        })
          .style("opacity", 1)
    })

  const animationLength = (path.length * 2 + 3) * delayUnit
  setTimeout(onAnimationFinish, animationLength)
}

class SkiGraph extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      start: null,
      end: null,
    }
  }

  render() {
    const reset = () => {
      this.setState({start: null, end: null})
      d3.selectAll("g.node circle").classed("selected", false)
      d3.selectAll("g.node").transition().duration(500).style("opacity", 1)
      d3.selectAll("g.edge").transition().duration(500).style("opacity", 1)
    }

    let displayText
    let onTextClick
    let textClass = "text"
    if (this.state.start === null) {
      displayText = "Pick start"
    } else if (this.state.end === null) {
      displayText = "Pick end"
    } else {
      // on this graph there should be a path between every pair of nodes
      const [_, path] = bfs(this.state.start, this.state.end, edgesData, nodesData)
      highlightPath(path, () => setTimeout(fadeInText, 500))
      displayText = "Reset"
      onTextClick = reset
      textClass += " reset-button"
    }

    return (
      <div id="ski-graph">
        <p
          onClick={onTextClick}
          className={textClass}
        >{displayText}</p>

        <svg width={SVG_WIDTH} height={SVG_HEIGHT}></svg>
      </div>
    )
  }

  componentDidMount() {
    let svg = d3.select("#ski-graph svg")
    graphUtils.setUpSvg(svg)

    const onNodeClick = (_, i, nodes) => {
      if (this.state.start != null && this.state.end != null) return

      // this is a pretty clumsy way to do animations but it's simple enough in this case.
      if (this.state.start == null) {
        fadeOutText()
        setTimeout(
          () => {
            this.setState({start: i})
            fadeInText()
          },
          delay
        )
      } else if (this.state.end == null) {
        fadeOutText()
        setTimeout(
          // fading the text back in is handled in a callback after the animation is finished
          () => this.setState({end: i}),
          delay
        )
      }
      d3.select(nodes[i]).classed("selected", true)
    }

    const nodeOpts = {
      onClick: onNodeClick,
    }

    const edgeOpts = {
      strokeFn: (d) => d.level ? colorMap[d.level] : "grey"
    }

    const scaledNodes = graphUtils.scaleNodeData(nodesData, SVG_WIDTH, SVG_HEIGHT)
    graphUtils.renderEdgesD3({svg: svg, edgeData: edgesData, nodeData: scaledNodes, directed: true, opts: edgeOpts})
    graphUtils.renderNodesD3({svg: svg, nodeData: scaledNodes, opts: nodeOpts})
  }
}

export default SkiGraph

import React from "react"
import * as THREE from "three"

var $ = require("jquery")

class Pipes extends React.Component {
  render() {
    return (
      <div id="pipes-container" className="container">
        <button name="start">Start/Reset</button>
        <div style={{display: "flex", alignItems: "center"}}>
          <p>Rotate Camera:</p>
          <input type="checkbox" name="toggle-rotate"/>
        </div>
        <div className="canvas"></div>
      </div>
    )
  }

  componentDidMount() {
    let container = $("#pipes-container .canvas")[0],
    bbox = container.getBoundingClientRect();

    let scene, camera;

    let renderer = new THREE.WebGLRenderer();
    renderer.setPixelRatio(window.devicePixelRatio);

    renderer.setSize(bbox.width, bbox.height);
    container.appendChild(renderer.domElement);

    const SPEED = 3, // units/frame
          R = 1, // cylinder radius
          L = 80, // size of cube boundary
          RADIAL_SEGMENTS = 32,
          MAX_SEGMENTS = 70, // max segments per pipe
          MIN_LENGTH = 5, // min length of a pipe segment
          MAX_LENGTH = 20,
          CUBE_CENTER = [L/2, L/2, L/2];

    const initialPositions = [
      [L/2, 0, L/2],
      [3/4*L, 3/4*L, 0],
      [L/2, L, L/2],
    ];
    const colors = [
      0x3182bd, // blue
      0x229954, // green
      0xF08080, // coral
    ];
    const MAX_PIPES = colors.length;
    let materials = [];
    for (const color of colors) {
      materials.push(new THREE.MeshStandardMaterial({color: color}));
    }

    const bounds = new THREE.Box3(new THREE.Vector3(0, 0, 0), new THREE.Vector3(L, L, L));

    // utils
    const randInt = function(min, max) {
      return Math.floor(Math.random() * (max - min)) + min;
    }

    const randChoice = function(arr) {
      return arr[Math.floor(Math.random()*arr.length)];
    }

    const newDirection = function(old_dir, position) {
      // return a new direction vector such that:
      //   - new direction is orthogonal to old direction
      //   - a pipe going in new_direction with MAX_LENGTH will stay in bounds
      let validDirs = directions.filter((new_dir) => {
        return (vector_dot(old_dir, new_dir) === 0) &&
              willBeInBounds(new_dir, position)
      });
      return randChoice(validDirs);
    }

    const willBeInBounds = function(dir, position) {
      const end_position = vector_add(position, vector_scale(dir, MAX_LENGTH + 2));
      return bounds.containsPoint(new THREE.Vector3(...end_position));
    }

    // utility functions for working with vectors
    // could probably make this cleaner by not converting between
    // js lists and THREE.Vector3's
    const pos_to_vec = function(pos) {
      return [pos.x, pos.y, pos.z];
    }

    const vector_scale = function(v, s) {
      let result = [];
      for (let i = 0; i < v.length; i++) {
        result.push(v[i] * s);
      }
      return result;
    }

    const vector_add = function(v1, v2) {
      let result = [];
      for (let i = 0; i < v1.length; i++) {
        result.push(v1[i] + v2[i]);
      }
      return result;
    }

    const vector_dot = function(v1, v2) {
      let result = 0;
      for (let i = 0; i < v1.length; i++) {
        result += v1[i] * v2[i];
      }
      return result;
    }

    const createCylinder = function() {
      let geometry = new THREE.CylinderGeometry(R, R, 0, RADIAL_SEGMENTS);
      let material = materials[numPipes];
      let mesh = new THREE.Mesh(geometry, material);
      scene.add(mesh);
      return mesh;
    }

    const createSphere = function() {
      let geometry = new THREE.SphereGeometry(R * 1.2, RADIAL_SEGMENTS, RADIAL_SEGMENTS);
      let material = new THREE.MeshStandardMaterial({color: colors[numPipes]});
      let mesh = new THREE.Mesh(geometry, material);
      scene.add(mesh);
      return mesh;
    }

    const rotateCylinder = function(c) {
      if (Math.abs(c.direction[0]) === 1) {
        c.mesh.rotateZ(Math.PI / 2);
      } else if (Math.abs(c.direction[2]) === 1) {
        c.mesh.rotateX(Math.PI / 2);
      }
    }

    const computeCameraPos = function() {
      const x = L * 1.5 * Math.sin(theta);
      const y = L * 1.5 * (Math.cos(theta) + 1);
      return [x, L/2, y];
    }

    const updateCamera = function() {
      camera.position.set(...computeCameraPos())
      camera.lookAt(...CUBE_CENTER)
    }

    const directions = [
      [1, 0, 0],
      [0, 1, 0],
      [0, 0, 1],
      [-1, 0, 0],
      [0, -1, 0],
      [0, 0, -1],
    ]

    let numSegments; // number of pipe segments that have been created
    let numPipes; // number of pipes that have been created
    let c; // keeps track of the current cylinder segment
    let theta = 8; // current camera rotation
    let omega = 0.01; // rotational speed
    let rotateCamera = false;

    let animationRequestId;

    const animate = function() {
      animationRequestId = requestAnimationFrame(animate);

      if (c.length < c.max_length) {
        c.length += SPEED;
        c.mesh.geometry.dispose();
        c.mesh.geometry = new THREE.CylinderGeometry(R, R, c.length, RADIAL_SEGMENTS);
        // need to make sure cylinder only grows in one direction
        const old_pos = pos_to_vec(c.mesh.position);
        const new_pos = vector_add(old_pos, vector_scale(c.direction, SPEED/2));
        c.mesh.position.set(...new_pos);
      } else if (numSegments++ < MAX_SEGMENTS) {
        // new pipe segment
        const end_position = vector_add(pos_to_vec(c.mesh.position), vector_scale(c.direction, c.length/2));
        const old_pos = pos_to_vec(c.mesh.position);
        const new_pos = vector_add(old_pos, vector_scale(c.direction, c.length/2));
        c = {
          length: 0,
          direction: newDirection(c.direction, end_position),
          max_length: randInt(MIN_LENGTH, MAX_LENGTH),
          mesh: createCylinder(),
        }
        c.mesh.position.set(...new_pos);
        rotateCylinder(c);
        // create sphere at junction
        let sphere = createSphere();
        sphere.position.set(...new_pos);
      } else if (numPipes < MAX_PIPES) {
        // finish the old pipe with a sphere
        const position = vector_add(pos_to_vec(c.mesh.position), vector_scale(c.direction, c.length/2));
        let sphere = createSphere();
        sphere.position.set(...position);

        if (numPipes < MAX_PIPES - 1) {
          numPipes++;
          numSegments = 0;
          newPipe(initialPositions[numPipes]);
        } else {
          init();
        }
      }

      if (rotateCamera) {
        theta += omega;
        updateCamera();
      }

      renderer.render(scene, camera);
    }

    const newPipe = function(position) {
      c = {
        length: 0,
        direction: newDirection([0, 0, 0], position),
        max_length: randInt(3, 5),
        mesh: createCylinder(),
      };
      rotateCylinder(c);
      c.mesh.position.set(...position);

      let s = createSphere();
      s.position.set(...position);
    }

    const setScene = function() {
      scene = new THREE.Scene();
      camera = new THREE.PerspectiveCamera(75, bbox.width/bbox.height, 0.1, 1000);

      updateCamera();

      let light = new THREE.AmbientLight(0x404040, 3);
      scene.add(light);

      let pointLight = new THREE.PointLight(0x404040, 3, 0);
      pointLight.position.set(L, L, L);
      scene.add(pointLight);

      renderer.render(scene, camera);
    }

    const init = function() {
      setScene();

      numSegments = 0;
      numPipes = 0;

      newPipe(initialPositions[0]);

      cancelAnimationFrame(animationRequestId);

      animate();
    }

    setScene();

    $("#pipes-container button[name=start]").click(init);
    $("#pipes-container input[name=toggle-rotate").change(() => rotateCamera = !rotateCamera)
  }
}

export default Pipes

import React from "react"
