      <ArrayInput
        arr={arr}
        setArr={setArr}
        reset={reset}
        setError={setError}
      />
      <h3>Solution Code</h3>
      <Code state={state} />
      {error &&
        <p><span>â</span> Error: {error}</p>
      }
      {!error &&
        <>
          <h3>Array Visualization</h3>
