import React from "react"
import Highlight, {defaultProps} from "prism-react-renderer"
import theme from "prism-react-renderer/themes/github"

import '../css/code_block.scss'

import Prism from "prism-react-renderer/prism"
import vsDark from 'prism-react-renderer/themes/vsDark'

// prism-react-renderer supports a small subset of languages that Prism does
(typeof global !== 'undefined' ? global : window).Prism = Prism;
["ruby", "clojure"].forEach((lang) => require(`../../node_modules/prismjs/components/prism-${lang}`))

const CodeBlock = ({ language, code }) => {
  defaultProps.theme = theme
  return (
    <Highlight {...defaultProps} code={code} language={language} theme={vsDark}>
      {({className, style, tokens, getLineProps, getTokenProps}) => (
        <pre className={className}>
          {/* don't render blank last lines (which are always present in markdown code blocks) */}
          {tokens.filter((line, i) => !(i === (tokens.length - 1) && line.length === 1 && line[0].empty)).map((line, i) => (
            <div key={i} {...getLineProps({line, key: i})}>
              {line.map((token, key) => (
                <span key={key} {...getTokenProps({token, key})} />
              ))}
            </div>
          ))}
        </pre>
      )}
    </Highlight>
  )
}

export default CodeBlock

import React from 'react'
import { useStaticQuery, graphql } from "gatsby"

import CodeBlock from './code_block'

function CodeBlockFromFile({ filePath }) {
  const data = useStaticQuery(graphql`
    query {
      allFile {
        nodes {
          fields {
            contents
          }
          relativePath
        }
      }
    }
  `)

  // we only need one file, but non-page queries cannot take parameters
  // https://github.com/gatsbyjs/gatsby/issues/9047
  const nodes = data.allFile.nodes.filter((node) => filePath === node.relativePath)
  if (nodes.length !== 1) {
    console.warn("Trouble locating file.")
  }
  const node = nodes[0]

  const ext = node.relativePath.split(".").pop()

  return <CodeBlock code={node.fields.contents} language={ext} />
}

export default CodeBlockFromFile

